import React from 'react';
import './App.css';
import { getCards } from './api';
import DataLoader from './components/DataLoader';
import Slider from './components/Slider';
import Card from './components/Card';

function App(props) {
  return (
    <DataLoader
      loadData={getCards}
      render={(state) => (
        <Slider>
          <Card state={state} />
        </Slider>
      )}
    />
  );
}

export default App;
